import React,{useState} from 'react'
import axios from 'axios'

export function AddEntryPage(){
  const [formState,setFormState] = useState({
    name:'',
    itemName:'',
    itemPrice:0.0,
    itemLink:''
  });
  handleName = event => {
    setFormState({name:event.target.value})
  }
  handleItemName = event => {
    setFormState({itemName:event.target.value})
  }
  handleItemPrice = event => {
    setFormState({itemPrice:event.target.value})
  }
  handleItemLink = event => {
    setFormState({itemLink:event.target.value})
  }
  handleSubmit = event =>{
    event.preventDefault();

    axios.post('http://localhost:8000/list/addEntry',{formState}).then(res=>{
      console.log(res);
      console.log(res.data);
    })
  }
    return (
    <div class="vh-100 bg-secondary text-center" onSubmit={handleSubmit}>
      <form>
        <label for="NameInput" class="form-label fw-bold text-capitalize fs-4">Name</label>
        <div class="d-flex justify-content-center">
          <input type="name" class="form-control w-25" id="NameInput" placeholder="Name" onChange={handleName}></input>
        </div>

        <label for="ItemNameInput" class="form-label fw-bold text-capitalize fs-4">Item Name</label>
        <div class="d-flex justify-content-center">
          <input type="name" class="form-control w-25" id="ItemNameInput" placeholder="Item Name" onChange={handleItemName}></input>
        </div>

        <label for="ItemPriceInput" class="form-label fw-bold text-capitalize fs-4">Item Price</label>
        <div class="d-flex justify-content-center">
          <input type="name" class="form-control w-25" id="ItemPriceInput" placeholder="Item Price" onChange={handleItemPrice}></input>
        </div>

        <label for="ItemLinkInput" class="form-label fw-bold text-capitalize fs-4">Item Link</label>
        <div class="d-flex justify-content-center">
          <input type="name" class="form-control w-25" id="ItemLinkInput" placeholder="Item Link" onChange={handleItemLink}></input>
        </div>
        <div class="d-flex justify-content-center">
        <button type="submit" class="btn btn-primary mt-2">Add Item</button>
        </div>
      </form>  
    </div>
  )
}
export default AddEntryPage
